To calculate the standard deviation in Kotlin, you can create a function to calculate the mean and another function to calculate the standard deviation. Here's how you can do it:

```kotlin
import kotlin.math.pow
import kotlin.math.sqrt

fun mean(heights: Array<Int>): Double {
    return heights.sum().toDouble() \/ heights.size
}

fun standardDeviation(heights: Array<Int>, mean: Double): Double {
    return sqrt(heights.map { pow(it.toDouble() - mean, 2.0) }.average())
}

fun main() {
    val maleHeights = arrayOf(0, 0, 2, 6, 23, 37, 20, 5)
    val femaleHeights = arrayOf(6, 25, 35, 21, 4, 1, 0, 0)

    val maleMean = mean(maleHeights)
    val maleStdDev = standardDeviation(maleHeights, maleMean)

    val femaleMean = mean(femaleHeights)
    val femaleStdDev = standardDeviation(femaleHeights, femaleMean)

    println("Male Heights: Mean = $maleMean, StdDev = $maleStdDev")
    println("Female Heights: Mean = $femaleMean, StdDev = $femaleStdDev")
}
```

This code defines two functions: `mean` and `standardDeviation`. The `mean` function calculates the mean (average) of the given heights array, while the `standardDeviation` function calculates the standard deviation. The `main` function initializes the heights arrays, calculates the mean and standard deviation for both males and females, and prints the results.

