from flask import Flask, request, session, cookies, redirect, url_for
from flask_socketio import SocketIO, emit, join_room, leave_room

app = Flask(__name__)
app.config['SECRET_KEY'] = 'secret_key_here'
socketio = SocketIO(app)

@app.route('\/')
def index():
    return '<a href="login">Login<\/a>'

@app.route('\/login', methods=['GET', 'POST'])
def login():
    if request.method == 'POST':
        username = request.form['username']
        password = request.form['password']
        if username == 'admin' and password == 'admin':
            access_token = generate_access_token(username)
            response = make_response(redirect(url_for('home')))
            response.set_cookie(access_token)
            return response
    return render_template('login.html')

@app.route('\/home')
def home():
    access_token = request.cookies.get('access_token')
    if access_token is None:
        return redirect(url_for('login'))
    user = check_database(access_token)
    if user is None:
        return redirect(url_for('login'))
    return render_template('home.html', user=user)

def generate_access_token(username):
    # Generate a secure access token using a secret key
    # For this example, we'll use a hard-coded secret key
    # In a real-world application, you should store the secret key securely
    secret_key = 'secret_key_here'
    token = hashlib.sha256(f'{username}:{secret_key}').hexdigest()
    return token

def check_database(access_token):
    # Check the access token against a database or other storage
    # For this example, we'll use a hard-coded dictionary
    # In a real-world application, you should use a database or other storage
    users = {
        'admin': 'admin',
    }
    if access_token in users:
        return users[access_token]
    return None

if __name__ == '__main__':
    socketio.run(app)
