def print_board(board):
    for row in board:
        print(" | ".join(row))
        print("-" * 5)


def is_valid_move(board, position):
    row, col = position
    return board[row][col] == " "


def is_win(board, player):
    for row in board:
        if row == [player] * 3:
            return True

    for col in range(len(board)):
        if all(board[row][col] == player for row in range(len(board))):
            return True

    if all(board[row][row] == player for row in range(len(board))):
        return True

    if all(board[len(board) - 1 - row][row] == player for row in range(len(board))):
        return True

    return False


def get_winner(board):
    if is_win(board, "X"):
        return "Player X"
    elif is_win(board, "O"):
        return "Player O"
    else:
        return "Draw"


def main():
