To initialize a dcc Graph in Dash Plotly that never needs to be re-plotted, you can set the `loading_state` property of the graph to `'none'`. This will prevent the graph from displaying a loading spinner while it is waiting for data to be updated.

In the callback associated with the graph, you can specify `[]` as the `Input()` parameter. This will tell Dash that the callback should be triggered when the app is first loaded, but not when any of the input values change.

Here is an example of how to use this technique:

```
import dash
import dash_core_components as dcc
import dash_html_components as html

app = dash.Dash(__name__)

app.layout = html.Div([
    dcc.Graph(id='graph', loading_state='none')
])

@app.callback(
    dash.dependencies.Output('graph', 'figure'),
    [dash.dependencies.Input([], 'initial_value')]
)
def update_figure(_):
    # Generate the figure data and return it
    return {
        'data': [{
            'x': [1, 2, 3],
            'y': [4, 5, 6]
        }],
        'layout': {
            'title': 'My Graph'
        }
    }

if __name__ == '__main__':
    app.run_server(debug=True)
```

In this example, the `update_figure()` callback is triggered when the app is first loaded, but not when any of the input values change. This is because the `Input()` parameter is set to `[]`. The callback generates the figure data and returns it, and the graph is displayed without displaying a loading spinner.

