In SystemVerilog, the `$signed()` function is used to convert an unsigned value to a signed value.

When you use the `$signed()` function, you pass an unsighed expression as an argument, and the function returns a signed value with the same bit width as the unsighed expression. The resulting signed value has the same numerical value as the unsighed expression, but with the sign bit set appropriately.

Here's an example:
```
