std::pair<double, std::vector<double>> average_and_square(const std::vector<double>& v) {
  \/\/ Compute the sum of the elements in the vector
  double sum = std::accumulate(v.begin(), v.end(), 0.0);

  \/\/ Compute the average of the elements in the vector
