def print_board(board):
    for row in board:
        print(" | ".join(row))
        print("-" * 5)


def is_valid_move(board, position):
    row, col = position
    return board[row][col] == " "


def is_win(board, player):
    for row in board:
        if row == [player] * 3:
            return True

    for col in range(len(board)):
        if all(board[row][col] == player for row in range(len(board))):
            return True

    if all(board[row][row] == player for row in range(len(board))):
        return True

    if all(board[len(board) - 1 - row][row] == player for row in range(len(board))):
        return True

    return False


def get_winner(board):
    if is_win(board, "X"):
        return "Player X"
    elif is_win(board, "O"):
        return "Player O"
    else:
        return "Draw"


def main():
    board = [[" "] * 3 for _ in range(3)]
    current_player = "X"
    print_board(board)

    while True:
        position = input(f"{current_player}'s turn (row col): ").split()
        if not is_valid_move(board, tuple(map(int, position))):
            print("Invalid move, try again.")
            continue

        row, col = map(lambda x: int(x) - 1, position)
        board[row][col] = current_player

        if get_winner(board) != "Draw":
            print_board(board)
            print(f"{get_winner(board)} wins!")
            break

        if current_player == "X":
            current_player = "O"
        else:
            current_player = "X"

        print_board(board)


if __name__ == "__main__":
    main()
