Here\'s one way to implement binary search in Python to return the index of the next element that is larger than an item:

``` 
def binary_search(arr, target):
    left = 0
    right = len(arr) - 1

    while left <= right:
        mid = (left + right) \/\/ 2

        if arr[mid] == target:
            return mid
        elif arr[mid] < target:
            left = mid + 1
        else:
            right = mid - 1

    return -1
```

This implementation uses a while loop to repeatedly divide the search range in half and compare the value at the midpoint to the target value. If the value is found, the loop is broken and the index of the next larger element is returned. If the value is not found, the loop continues and the search range is updated to move right. If the loop completes without finding the value, the function returns -1 to indicate that the value was not found in the given array.

