struct Interval {
    let start: Int
    let end: Int

    init(_ start: Int, _ end: Int) {
        self.start = start
        self.end = end
    }

    static func + (lhs: Interval, rhs: Interval) -> Interval? {
        guard lhs.end >= rhs.start else { return nil }
        return Interval(lhs.start, max(lhs.end, rhs.end))
    }
}
```

Next, let's create an `IntervalTreeNode` struct to represent a node in the interval tree:

```swift
struct IntervalTreeNode<Value: Comparable> {
    let interval: Interval
    let value: Value
    var left: IntervalTreeNode?
    var right: IntervalTreeNode?

    init(_ interval: Interval, _ value: Value) {
        self.interval = interval
        self.value = value
        self.left = nil
        self.right = nil
    }
}
```

Now, let's create the `IntervalTree` class:

```swift
class IntervalTree<Value: Comparable> {
    var root: IntervalTreeNode<Value>?

    init() {}

    func insert(_ interval: Interval, _ value: Value) {
        root = insertNode(root, interval, value)
    }

    func queryIntervals(in interval: Interval) -> [Interval] {
        return queryIntervalsHelper(root, interval)
    }

    private func insertNode(_ node: IntervalTreeNode<Value>?, _ interval: Interval, _ value: Value) -> IntervalTreeNode<Value>? {
        guard let node = node else {
            return IntervalTreeNode(interval, value)
        }

        if interval.start < node.interval.start {
            return insertNode(node.left, interval, value)
        }

        if interval.end > node.interval.end {
            return insertNode(node.right, interval, value)
        }

        if interval.end > node.interval.end {
            node.value = value
        }

        return node
    }

    private func queryIntervalsHelper(_ node: IntervalTreeNode<Value>?, _ queryInterval: Interval) -> [Interval] {
        guard let node = node else { return [] }

        if queryInterval.start <= node.interval.start {
            let leftResult = queryIntervalsHelper(node.left, queryInterval)
            return leftResult + [node.interval] + queryIntervalsHelper(node.right, queryInterval)
        }

        if queryInterval.end >= node.interval.end {
            return queryIntervalsHelper(node.right, queryInterval)
        }

        return []
    }
}
```

