```
<script type="text\/javascript">
  document.addEventListener('DOMContentLoaded', function() {
    var halfDayCheckbox = document.getElementById('request_unit_half');
    var durationInput = document.getElementById('duration_display');
    var morning choice = document.getElementById('morning_choice');
    var afternoonChoice = document.getElementById('afternoon_choice');

    halfDayCheckbox.addEventListener('change', function() {
      if (halfDayCheckbox.checked) {
        durationInput.style.display = 'none';
        morningChoice.style.display = 'block';
        afternoonChoice.style.display = 'block';
      } else {
        durationInput.style.display = 'block';
        morningChoice.style.display = 'none';
        afternoonChoice.style.display = 'none';
      }
    });
  });
<\/script>
```
In this code, we first get references to the "Half Day" checkbox, the "Duration" field, and the "Morning" and "Afternoon" choices using `document.getElementById()`. We then add an event listener to the "Half Day" checkbox that listens for a change in its state. When the checkbox is selected (i.e., its state changes to "true"), we hide the "Duration" field and show the "Morning" and "Afternoon" choices. When the checkbox is unselected (i.e., its state changes to "false"), we show the "Duration" field and hide the "Morning" and "Afternoon" choices.

Note that we use the `style.display` property to show or hide the elements. When we set this property to `'none'`, the element will not be visible. When we set it to `'block'`, the element will be visible and will take up space in the layout.

